import React from 'react'
import { StyledSpan, StyledTitle } from '../../../styles/typography'

const Technologies = ({tech}) => {
  return (
    <li>
        <StyledTitle fontSize="four" text="one" tag="h2">{tech.title}</StyledTitle>
        <StyledSpan fontSize="two" color="one">{tech.status}</StyledSpan>
    </li>
  )
}

export default Technologies
